function Login() {
   return (
      <div className="page page-centered">
         <h1>Вход в аккаунт</h1>
         <p>
            Здесь будет форма авторизации пользователей сервиса «Паровозик
            Томас». Сейчас это заглушка.
         </p>
      </div>
   );
}

export default Login;
